sys_variable_value.value:
(function execute(inputs, outputs) {

  try {
    const newRepo = JSON.parse(inputs.response_body);
    outputs.id = newRepo.id;
    outputs.name = newRepo.name;
    outputs.ssh_url = newRepo.ssh_url;
    outputs.default_branch = newRepo.default_branch;
  } catch (e) {

  }

})(inputs, outputs);

